import React, {useState} from 'react';
import Disp from './Disp.jsx';

function DisplayMonths(){
    const [task, update] = useState([]);

    function handleClick() {
        var t = "New Task"
        update(t);
      }

      console.log(task);
    
      return (
        <div className="App">
        <Disp task = {task} />
        <button className = "btn" onClick={handleClick}>Add Task</button>
        </div>
      );

}

export default DisplayMonths;
